function calculateContractBillingOnDate(t,e){return"Transactional"===t.Type?t.Matters.reduce(function(r,n){return r+calculateMatterBillingOnDate(t,n,e)},0):0}function calculateMatterBillingOnDate(t,e,r){return e.DataSets.reduce(function(e,r){return e+r.DataSize*t.TransactionalPricePerGB},0)}var currencyFormatter=Intl.NumberFormat("en-US",{style:"currency",currency:"USD"});